If your Command spends time waiting for IO - maybe it is reading a file or connecting to a server - it blocks the main process for that duration. This means the window becomes unresponsive, and your app freezes . To avoid this problem Rust has builtin support asynchronous functions through the Future Trait . A familiar concept if you already know about Promise and async/await in JavaScript. You declare an asynchronous command by writing async fn instead of fn: #[tauri::command]
async fn async_command() {} Async Commands are executed on a thread pool using tauri::async_runtime::spawn() , so long-running tasks no longer block the Core's main thread. Because Commands map to JavaScript promises in the Frontend, they also don't block the Frontend's main thread. To execute non-async , regular Commands on a different thread, define the macro like so: #[tauri::command(async)]. Listing-TODO shows a more complete example that uses the non-blocking tokio::fs::read() function to read a file from disk, convert it to a Utf8 string and parse it into a Vec of lines. It also uses the previously introduced thiserror and serde::Serialize to create a custom Error type. use std::path::PathBuf; // A custom error type that represents all possible in our command
#[derive(Debug, thiserror::Error)]
enum Error { #[error("Failed to read file: {0}")] Io(#[from] std::io::Error), #[error("File is not valid utf8: {0}")] Utf8(#[from] std::string::FromUtf8Error),
} // we must also implement serde::Serialize
impl serde::Serialize for Error { fn serialize<S>(&self, serializer: S) -> Result<S::Ok, S::Error> where S: serde::ser::Serializer, { serializer.serialize_str(self.to_string().as_ref()) }
} async fn async_read_lines(path: PathBuf) -> Result<Vec<String>, Error> { // read bytes a non-blocking way let bytes = tokio::fs::read(path).await?; // convert bytes into utf8 string let string = String::from_utf8(bytes)?; // splitting at newline characters let lines = string .split('\n') .map(|line| line.to_string()) .collect::<Vec<_>>(); Ok(lines)
} Listing 2-TODO: A more complete examples that uses non-blocking APIs to read a file into a Vec of lines.

