When your first learned Rust, you might have printed logging messages by using the println! macro: fn main() { println!("foobar");
} However, for more complex projects, Rust provides an elegant logging system that allows log messages from app code and dependencies with different levels, timestamps, and metadata. To use this system, add the log crate to your Cargo.toml file: [package]
name = "app"
version = "0.1.0"
edition = "2021" [dependencies]
log = "0.4" Now you can use a number of logging macros: error! , warn! , info! , debug! and trace! where error! represents the highest-priority log. use log::{trace, debug, info, warn, error}; fn main() { trace!("A trace-level message"); debug!("A debug-level message"); info!("An info-level message"); warn!("A warn-level message"); error!("An error-level message");
} However, you will notice it doesn't actually print anything when you run this! This is because log expects you to bring your own logger. There are many available implementations to choose from, here are some of the most popular ones: Simple minimal loggers: env_logger simple_logger simplelog pretty_env_logger stderrlog flexi_logger Complex configurable frameworks: log4rs fern

