Sometimes simple logs are not enough to debug your problem, though, so you might reach for the tracing crate. In addition to logging-style diagnostics recorded by the log crate, it provides information about temporality and causality . Spans in tracing are events that have a beginning and end time, may be entered and exited by the flow of execution, and may exist within a nested tree of similar spans. use tracing::{info, debug, span, Level}; // records an event outside of any span context:
info!("something happened"); let span = span!(Level::INFO, "my_span");
let _guard = span.enter(); // records an event within "my_span".
debug!("something happened inside my_span");

