Cargo comes with a builtin test runner - cargo test - that will run unit tests and report passes and failures. The simplest test in rust is a function with the test attribute. To change a plain function into a test, add #[test] to the line before fn. Since it's common to write many small tests to ensure different expectations, Rust unit tests are commonly grouped into Test Modules : #[cfg(test)]
mod tests { #[test] fn first_test() { assert_eq!(2 + 2, 4); } #[test] fn second_test() { assert_eq!(4 + 4, 8); }
} A simplified Rust test suite containing two very basic tests. The #[cfg(test)] attribute ensures that the module is only compiled when running cargo test but stripped when you build the binary for development or release. To learn more, see the Conditional Compilation reference. The function body uses the assert_eq! macro to assert that 2 + 2 equals 4 and 4 + 4 equals 8.

