Selenium is a web automation framework that exposes bindings to WebDriver APIs in many languages. Their Node.js bindings are available under the selenium-webdriver package on NPM. Unlike the WebdriverIO Test Suite , Selenium does not come out of the box with a Test Suite and leaves it up to the developer to provide one. We chose Mocha for this example, since it's a popular choice. Install the test runner npm npm install mocha chai selenium-webdriver yarn yarn add -D mocha chai selenium-webdriver pnpm pnpm add -D mocha chai selenium-webdriver Connect your Tauri app The following code will start an instance of your app before tests are run and ensure the instance is terminated afterwards. Let's add it to the default mocha testing file: Filename: test/test.js const os = require("os");
const path = require("path");
const { spawn, spawnSync } = require("child_process");
const { Builder, By, Capabilities } = require("selenium-webdriver"); // create the path to the expected application binary
const application = path.resolve( __dirname, "..", "..", "..", "target", "release", "hello-tauri-webdriver"
); // keep track of the webdriver instance we create
let driver; // keep track of the tauri-driver process we start
let tauriDriver; before(async function () { // set timeout to 2 minutes // to allow the program to build if it needs to this.timeout(120000); // ensure the program has been built spawnSync("cargo", ["build", "--release"]); // start tauri-driver tauriDriver = spawn( path.resolve(os.homedir(), ".cargo", "bin", "tauri-driver"), [], { stdio: [null, process.stdout, process.stderr] } ); const capabilities = new Capabilities(); capabilities.set("tauri:options", { application }); capabilities.setBrowserName("wry"); // start the webdriver client driver = await new Builder() .withCapabilities(capabilities) .usingServer("http://localhost:4444/") .build();
}); after(async function () { // stop the webdriver session await driver.quit(); // kill the tauri-driver process tauriDriver.kill();
}); Listing 2-TODO: Example Selenium file that launches a Tauri app before tests are run and kills the app after all tests finished.

