Most commonly, you want to intercept IPC requests; this can be helpful in a variety of situations: Ensure the correct backend calls are made Simulate different results from backend functions Tauri provides the mockIPC function to intercept IPC requests. You can find more about the specific API in detail here . The following examples use Vitest , but you can use any other frontend testing library such as jest. import { beforeAll, expect, test } from "vitest";
import { randomFillSync } from "crypto"; import { mockIPC } from "@tauri-apps/api/mocks";
import { invoke } from "@tauri-apps/api/tauri"; // jsdom doesn't come with a WebCrypto implementation
beforeAll(() => { window.crypto = { getRandomValues: function (buffer) { return randomFillSync(buffer); }, };
}); test("invoke simple", async () => { mockIPC((cmd, args) => { // simulate rust command called "add" if (cmd === "add") { return args.a + args.b; } }); expect(invoke("add", { a: 12, b: 15 })).resolves.toBe(27);
}); Listing 2-TODO: Vitest test file showing a mocked command handler that simulates a simple add function. Sometimes you want to track more information about an IPC call; how many times was the command invoked? Was it invoked at all? You can use mockIPC() with other spying and mocking tools to test this: import { beforeAll, expect, test, vi } from "vitest";
import { randomFillSync } from "crypto"; import { mockIPC } from "@tauri-apps/api/mocks";
import { invoke } from "@tauri-apps/api/tauri"; // jsdom doesn't come with a WebCrypto implementation
beforeAll(() => { //@ts-ignore window.crypto = { getRandomValues: function (buffer) { return randomFillSync(buffer); }, };
}); test("invoke", async () => { mockIPC((cmd, args) => { // simulate rust command called "add" if (cmd === "add") { return args.a + args.b; } }); // we can use the spying tools provided by vitest // to track the mocked function const spy = vi.spyOn(window, "__TAURI_IPC__"); expect(invoke("add", { a: 12, b: 15 })).resolves.toBe(27); expect(spy).toHaveBeenCalled();
}); Listing 2-TODO: The mocked __TAURI_IPC__ is compatible with existing testing tools.

