Sometimes you have window-specific code (a splash screen window, for example), so you need to simulate different windows. You can use the mockWindows() method to create fake window labels. The first string identifies the "current" window (i.e., the window your JavaScript believes itself in), and all other strings are treated as additional windows. mockWindows() only fakes the existence of windows but no window properties. To simulate window properties, you need to intercept the correct calls using mockIPC() import { beforeAll, expect, test } from "vitest";
import { randomFillSync } from "crypto"; import { mockWindows } from "@tauri-apps/api/mocks"; // jsdom doesn't come with a WebCrypto implementation
beforeAll(() => { //@ts-ignore window.crypto = { getRandomValues: function (buffer) { return randomFillSync(buffer); }, };
}); test("invoke", async () => { mockWindows("main", "second", "third"); const { getCurrent, getAll } = await import( "@tauri-apps/api/window" ); expect(getCurrent()).toHaveProperty("label", "main"); expect(getAll().map((w) => w.label)).toEqual([ "main", "second", "third", ]);
}); Listing 2-TODO: A vitest test file with 3 mocked windows.
